  const handleClick = (ref) => {
    ref.current.scrollIntoView({
      behavior: 'smooth',
      block: 'start',
    });
  }

    return (
      <button
          className="image_btn"
          type="button"
          onClick={() => {
            setMatched(calcMatch(liked, disliked, superliked))
